1) Преобразовать имя "Шевченко" в формат с употреблением статьи "Иван Франко" (если предполагается, что речь идет о Франке, а не о Шевченко);
2) Дата "До побега" заменить на "Перед отъездом";
3) Слово "к г б" заменить на "Королевский генеральный бунк";
4) Слово "никаких прямых доказательств" оставить без изменений;
5) Слово "о его шпионаже" оставить без изменений.

Итак, денормализованный текст будет выглядеть следующим образом:
"Перед отъездом Ивана Франко в Королевский генеральный бунк не было никаких прямых доказательств о его шпионаже."
